export type IconName = keyof typeof iconMap;

const getIconPath = (name: IconName) => {
  if (!(name in iconMap)) {
    console.warn(`The icon ${name} was not found.`);
    return null;
  }
  return iconMap[name];
};

interface IconProps {
  name: IconName;
  className?: string;
  size?: 12 | 16 | 18 | 20 | 24 | 32;
}

export const Icon: React.FunctionComponent<IconProps> = ({
  name,
  size,
  className,
}) => (
  <svg
    className={classNames("ff-icon", className)}
    width={size || 20}
    height={size || 20}
    viewBox="0 0 20 20"
  >
    {getIconPath(name)}

    <style jsx>{`
      .ff-icon {
        display: block;
      }
    `}</style>
  </svg>
);
